import React from "react";

const Services4 = () => {
  return (
    <div className="container">
      <div className="row services3-box2 p-4">
        <div className="col-12 col-md-6">
          <h1>Resell Under your Brand</h1>
          <p>
            <b>
              The White Label Service is a great solution for Resellers who want
              to sell the service under different policies, pricing, and of
              course under their own brand.
            </b>
          </p>
        </div>
        <div className="col-12 col-md-6 col-image">
          <img
            src="https://signagetv.in/wp-content/uploads/2021/04/Group-1063.png"
            alt=""
          />
        </div>
      </div>
    </div>
  );
};

export default Services4;
